import React from "react";
import '../cssFile/'

export default function NavBarList(props) {
  return (
    <div id={props.showOrHide ? "Show" : "Hide"}>
      <ul className="list-group">
        <li className="list-group-item">My Profile</li>
        <li className="list-group-item">Contact Us</li>
        <li className="list-group-item">Log Out</li>
      </ul>
    </div>
  );
}
